import logo from "./logo.svg";
import "./App.css";
import CodeField from "./Components/CodeBox";
import AppManager from "./Models/AppModel";
import OutputBox from "./Components/OutputBox";

function App() {
  return (
    <>
      <AppManager>
        <CodeField></CodeField>
        <OutputBox></OutputBox>
      </AppManager>
    </>
  );
}

export default App;
